def processRequest(req):
    if req.get("result").get("action") == "yahooWeatherForecast":
        
        baseurl = "https://query.yahooapis.com/v1/public/yql?"
        yql_query = makeYqlQuery(req)
        if yql_query is None:
            return {}
        yql_url = baseurl + urlencode({'q': yql_query}) + "&format=json"
        result = urlopen(yql_url).read()
        data = json.loads(result)
        res = makeWebhookResult(data)
        return res
    elif req.get("result").get("action") == "test":
        
        res = {
            "speech": "you get this right from the test ",
            "displayText": "you get this right",
            # "data": data,
            # "contextOut": [],
            "source": "apiai-weather-webhook-sample"
        }    
        return res
    elif req.get("result").get("action") == "Start_collage":
        res = makeWebhookCollage(req)
        return res
    elif req.get("result").get("action") == "Sport_collage":
        res = makeWebhookCollage_sport(req)
        return res
    elif req.get("result").get("action") == "infornation_university":
        res = information_university(req)
        return res
    return {}
